class PollingWorker(QRunnable):
    '''worker thread'''
    def __init__(self,*args,**kwargs):
        super(PollingWorker,self).__init__()
        self.args=args
        self.kwargs=kwargs
        self.running=True
        self.signals=Signals()

    @pyqtSlot()
    def STOP(self):
        self.running=False

    @pyqtSlot()
    def run(self):
        self.signals.result.emit({})
        self.signals.update.emit('')
        self.signals.result.emit('')
class Window(QMainWindow,QWidget):
    #itemui add catalog
    def setup_catalog_item_ui(self):
        self.window_2.catalog_submit.clicked.connect(self.addBatch)
        self.getBatch()

    def addBatch(self):
        caller=self.sender().objectName()
        print(caller)
        currentItem=False
        if caller in ['catalog_in_batch_results']:
            currentItem=self.window.catalog_in_batch_results.currentItem()
        elif caller == 'results':
            currentItem=self.window.results.currentItem()
        elif caller in ['catalog_submit',]:
            currentItem=self.item_edit_current_item

        id=int(currentItem.text().split(':')[1])
        print("add batch")
        JSON=dict(
        productID=id,
        batch_number=self.window_2.catalog_batch_number.value(),
        in_batch=self.window_2.catalog_in_batch.isChecked(),
        comments=self.window_2.catalog_comments.toPlainText(),
        )
        response=requests.post('{server}/holzcraftsframes/catalog/addbatch/'.format(server=self.window.server.text()),headers={'Authorization':'Token {}'.format(self.window.token.text())},json=JSON)
        print(response)
        if response.status_code == 200:
            QMessageBox.information(self,"Success","successfully updated item batch.")
        else:
            QMessageBox.warning(self,"Failure","Failed to update batch!")

    def getBatch(self):
        print(self.sender().objectName())
        if self.sender().objectName() == 'results':
            currentItem=self.window.results.currentItem()
        else:
            currentItem=self.window.catalog_in_batch_results.currentItem()

        id=int(currentItem.text().split(':')[1])
        response=requests.post('{server}/holzcraftsframes/catalog/getbatch/'.format(server=self.window.server.text()),headers={'Authorization':'Token {}'.format(self.window.token.text())},json={'productID':id})
        JSON=response.json()
        self.window_2.catalog_batch_number.setValue(JSON.get('batch_number'))
        self.window_2.catalog_in_batch.setChecked(JSON.get('in_batch'))
        self.window_2.catalog_comments.setPlainText(JSON.get('comments'))
        if response.status_code == 200:
            QMessageBox.information(self,"Batch Info. Rx.","Batch Information Retrieved!")
        else:
            QMessageBox.warning(self,"Batch Info. Rx. Error","Batch Information was not retrieved!")
