    photobooth_image=None
    def photobooth_run_camera(self):
        cv2.namedWindow("photobooth")
        vc = cv2.VideoCapture(self.window.photobooth_camera.value())
        cv2.setWindowProperty("preview", cv2.WND_PROP_TOPMOST, 1)

        if vc.isOpened(): # try to get the first frame
            rval, frame = vc.read()
        else:
            rval = False
        data=None
        while rval:
            cv2.imshow("photobooth", frame)
            rval, frame = vc.read()
            #print(type(frame))

            key = cv2.waitKey(20)
            if key == 32: # exit on ESC
                self.photobooth_rendered=Image.fromarray(frame)
                self.photobooth_qim=ImageQt(self.photobooth_rendered)
                self.photobooth_qim=self.photobooth_qim.rgbSwapped()
                self.photobooth_pix.setPixmap(QPixmap.fromImage(self.photobooth_qim))
                break
        vc.release()
        cv2.destroyWindow("photobooth")
    def setup_photobooth(self):
        #self.ocr_pix.setPixmap(QPixmap.fromImage(self.ocr_qim))
        self.window.photobooth_capture.clicked.connect(self.photobooth_run_camera)
        self.photobooth_scene=QGraphicsScene()
        self.photobooth_rendered=Image.new(size=(400,400),mode="RGBA",color=(255,0,0))
        self.photobooth_qim=ImageQt(self.photobooth_rendered)
        self.photobooth_pix=QGraphicsPixmapItem()
