    def run_camera(self):
        cv2.namedWindow("preview")
        vc = cv2.VideoCapture(self.window.scan2text_camera.value())
        cv2.setWindowProperty("preview", cv2.WND_PROP_TOPMOST, 1)

        if vc.isOpened(): # try to get the first frame
            rval, frame = vc.read()
        else:
            rval = False
        data=None
        while rval:
            cv2.imshow("preview", frame)
            rval, frame = vc.read()
            #print(type(frame))
            try:
                a=zbar.decode(frame)
                if a:
                    data=a
                    break
            except Exception as e:
                print(e)
            key = cv2.waitKey(20)
            if key == 27: # exit on ESC
                break
        vc.release()
        cv2.destroyWindow("preview")
        if data:
            self.window.scan2text_resultView.setPlainText('\n--Code Separator--\n'.join([i.data.decode('utf-8') for i in data]))
            pyperclip.copy(self.window.scan2text_resultView.toPlainText())
