        #self.window.sku_2.setEnabled(True)
        self.window.sku_c.setChecked(True)
        self.window.search.clicked.emit()
        index_count=self.window.tabWidget.count()
        index=0
        for i in range(index_count):
            text=self.window.tabWidget.tabText(i)
            if text == 'Search':
                index=i
        self.window.tabWidget.setCurrentIndex(index)
